import React, { Component } from "react";
import Link from "next/link";
import { Navbar, Nav, NavDropdown, Form, FormControl, Button, Jumbotron } from 'react-bootstrap';
import ReactJumbotron from './common/Jumbotron';
import Header from './common/Header'

class Home extends Component {
    render() {
        const href = {
            pathname: "/about",
            query: { name: "next" }
        }
        // the path inside pages directory + query string

        const as = {
            pathname: "/about/next",
            hash: "title-1"
        }
        // the path that will be rendered in the browser URL bar.
        return (
            <React.Fragment>
                   <Header/>
                <ReactJumbotron/>
                <style jsx>
                    {`
                        h1{
                            color: #fff;
                            text-align:center;
                            padding:5%
                        }
                        div{
                            background: white
                        }
                        a{
                            font-size:20px;
                            color:black;
                            text-decoration:none
                        }
                    `}

                </style>
                <style global jsx>
                    {`
                            body{
                                background:white
                            }
                        `}
                </style>
            </React.Fragment>

        )
    }
}

export default Home
